import React from "react";
import './footer.css'

export default class Footer extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            name: "",
            number: ""
        }
    }

    handleChange(event) {
        this.setState({ name: event.target.value, number: event.target.value });
    }

    render() {
        return(
            <div id="footer">
                <div className="container">
                <input className="inputName" placeholder="Name..." type="text" />
                <input className="inputNumber" onWheel={(e) => e.target.blur()} placeholder="Number..." type="number" />
                </div>
                <div id="btn">Add new contact</div>
            </div>
        )   
    }
}
